import React from "react";
import { NavLink } from "react-router-dom";
import { logo, basket, account } from "../assets/index.js";
import "../Styles/styles.css";

export const Navbar = () => {
  return (
    <>
      <nav className="navbar">
        <NavLink className="logo-nav" to="/">
          <img className="logo" src={logo} />
        </NavLink>
        <NavLink to="/men" className="nav">
          <p>Men</p>
        </NavLink>
        <NavLink to="/women" className="nav">
          <p>Women</p>
        </NavLink>
        <NavLink to="/kids" className="nav">
          <p>Kids</p>
        </NavLink>
        <NavLink to="/favorites" className="nav">
          <p>Favorites</p>
        </NavLink>
      </nav>

      <NavLink to="/account">
        <img src={account} className="icon" />
      </NavLink>
      <NavLink to="/basket">
        <img src={basket} className="icon" />
      </NavLink>
    </>
  );
};
